const Cart = () => {
    const CartItem = [{
        id:'m2',
    Name:'Decaf', 
    description : 'Decaf coffee is brewed with these decaffeinated beans.' ,
    prize : 550}].map(item => <li>{item.Name}</li>)
    return(
    

    <React.Fragment>
            <div>{CartItem}</div>
            <span>Total</span>
            <span>330</span>
            
    </React.Fragment>
    )
}
export default Cart;
